package com.example.myapplication
import kotlin.random.Random
fun generate():ArrayList<ListItemData> {
    val imagines = listOf(
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
        "data:image/jpeg;base64,"
    )
    var names= ArrayList<ListItemData>()
    var a: String
    for (i in 1 until 103) {
        a = imagines[Random.nextInt(0, imagines.size)]
        names.add(ListItemData("title$i","subtitle$i",a))
